import { Component, OnInit } from '@angular/core';
import { ApiserviceService } from 'src/app/apiservice.service';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit{
  extypeData: any[] = [
    { extypeID: 1, extypeName: 'foods' },
    { extypeID: 2, extypeName: 'tools' },
    { extypeID: 3, extypeName: 'entertainment' },
    // Other objects...
  ];
  selectedExType: string = '';
  inctypeData: any;

  constructor(private service: ApiserviceService) { }

 ngOnInit(): void {
   this.service.getAllExType().subscribe(data => {
    this.extypeData = data;
    console.log(this.extypeData);
   })
   this.service.getAllIncType().subscribe(data => {
    this.inctypeData = data;
   })
 }
}
